import Navbar from './components/navbar'
import React from "react";
import "./payment.css"
import Footer from './components/footer'
import NavbarLogin from './components/navbarLogin';
import { useParams } from 'react-router-dom';
import { useState,useEffect } from 'react';
import { API } from './config/api';


function Payment(){
    const idUser= JSON.parse(sessionStorage.getItem('user'));
    
    // Create function get products data from database here ...
const arr=[]
    const getUser = async () => {
      try {
        const response = await API.get(`/user/${idUser}`);
        arr.push(response.data.newdata.idTrip)
       
      } catch (error) {
        console.log(error);
      }
    };
    getUser()
   console.log(arr[0])
   const [trip, setTrip] = useState([]);

     // Create function get products data from database here ...
     const getTrip = async () => {
       try {
         const response = await API.get(`/trip/${arr}`);
         setTrip(response.data.data);
       } catch (error) {
         console.log(error);
       }
     };
     // Call function get products with useEffect didMount here ...
     useEffect(() => {
       getTrip();
     }, []);
     console.log(trip)
    return(
        <>
        <NavbarLogin/>
        <div id="pay-container">
            
            <div id="card">
            <div id="pay-top">
                <img src={require("./components/assets/Icon.png").default} alt="icon"/>
                <div id="booking">
                    <h1>Booking</h1>
                    <p>Saturday, 22 Juy 2020</p>
                </div>
            </div>
            <div id="main-con">
                <div id="main-pay">
                    <div id="pay-name">
                    <h1>6D/4N Fun Tassie Vacation</h1 >
                    <p>Australia</p>
                    </div>
                    <div id="date">
                        <h3>Date Trip</h3>
                        <p>26 August 2020</p>
                    </div>
                    <div id="duration">
                        <h3>Duration</h3>
                        <p>6 Day 4 Night</p>
                    </div>
                    <div id="status">
                        <span>Waiting Payment</span>
                    </div>
                    <div>
                        <h3>Accomodation</h3>
                        <p id="accomodation">Hotel 4 Nights</p>
                    </div>
                    <div>
                        <h3 >Transporartion</h3>
                        <p id="transporartion">Qatar Airways</p>
                    </div>
                </div>
                <div id="photo">
                    <img src= {require("./components/assets/2204979_20170708045545 1.png").default} alt="photo"/>
                    <p>upload payment proof</p>
                </div>
            </div>
            <table class="table">
  <thead>
    <tr>
      <th scope="col">No</th>
      <th scope="col">Full Name</th>
      <th scope="col">Phone</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td></td>
      <td></td>
      <td></td>
    </tr>
  </tbody>
</table>
            
            </div>
            <button id="btn-pay">Pay</button>
            

        </div>
        <Footer/>
        </>
    )
}
export default Payment
